    background-repeat: no-repeat;
    background-clip: border-box;
    background-position: 10px 10px;
    background-size: 20px;
    padding: 10px;
    padding-left: 40px;
    background-color: transparent;
    border: none;
    border-bottom: 2px #000000 solid;
